import { NavLink, Outlet } from 'react-router-dom';
import s from './TeamPage.module.css';

const TeamPage = () => {
	return (
		<div className={s.team_page}>
			<h1>Команда</h1>

			<div className={s.team_section}>
				<div className={s.team_nav}>
					<NavLink to={''}>Мій відділ</NavLink>
					<NavLink to={'my-holidays/'}>Відпустки</NavLink>
					<NavLink to={'company-structure/'}>Структура компанії</NavLink>
				</div>
				<div className={s.team_container}></div>
			</div>
			<Outlet />
		</div>
	);
};

export default TeamPage;
